'use strict';(function(){const indexCfg={encode:false,tokenize:function(str){const chineseRegex=/\W/;let words=str.split(/\s/);return words.flatMap(word=>{if(chineseRegex.test(word)){return word.split('');}else{return[word];}});}};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/notes/tools/api/','title':"API",'content':"seafile  上传文件：https://download.seafile.com/published/web-api/v2.1/file-upload.md  目录  seafile   "});index.add({'id':1,'href':'/notes/program/bash/','title':"Bash",'content':"颜色[1] 表 1: 终端颜色转义码列表    颜色 转义码    正常 \\e[0m  红色 \\e[31m  绿色 \\e[32m     状态码[2] 表 2: 状态码    状态码 含义    1 其他错误  2 使用 shell 内建命令出错  126 命令无法执行  127 命令未找到  128 无效的参数  130 取消     备忘单 https://devhints.io/bash。\n参考文献 [1] FLOZZ. Bash tips: Colors and formatting (ANSI/VT100 Control sequences)[EB/OL]([日期不详]). https://misc.flogisoft.com/bash/tip_colors_and_formatting.\n [2] ORNBO G. Linux and Unix exit code tutorial with examples[EB/OL](2019–11–16). https://shapeshed.com/unix-exit-codes/.\n  目录  颜色[1] 状态码[2] 备忘单 参考文献   "});index.add({'id':2,'href':'/notes/categories/','title':"Categories",'content':""});index.add({'id':3,'href':'/notes/program/css/','title':"CSS",'content':"对齐 # 靠右对齐 text-align: right; 目录  对齐   "});index.add({'id':4,'href':'/notes/program/golang/','title':"Golang",'content':"time 时间格式  2006-01-02 15:04:05 -0700  目录  time  时间格式    "});index.add({'id':5,'href':'/notes/program/html/','title':"HTML",'content':"Language Code[1] 表 1: ISO 639-1 Language Codes    Language ISO Code    Chinese (Simplified) zh-Hans     参考文献 [1] W3SCHOOLS. HTML Language Code Reference[EB/OL]([日期不详]). https://www.w3schools.com/tags/ref_language_codes.asp.\n  目录  Language Code[1] 参考文献   "});index.add({'id':6,'href':'/notes/program/js/','title':"JavaScript",'content':"导航到新地址[1] window.location.href = \u0026#39;...\u0026#39;; 得到链接的 href 属性[2] document.getElementById(\u0026quot;aaa\u0026quot;).href; 移动元素[3] newParent.appendChild(element); 参考文献 [1] STACKOVERFLOW. How to get the browser to navigate to URL in JavaScript [duplicate][EB/OL](2009–08–04). https://stackoverflow.com/a/1226718.\n [2] STACKOVERFLOW. Get local href value from anchor (a) tag[EB/OL](2013–03–15). https://stackoverflow.com/a/15439946.\n [3] STACKOVERFLOW. How to move all HTML element children to another parent using JavaScript?[EB/OL](2014–01–03). https://stackoverflow.com/questions/20910147/how-to-move-all-html-element-children-to-another-parent-using-javascript.\n  目录  导航到新地址[1] 得到链接的 href 属性[2] 移动元素[3] 参考文献   "});index.add({'id':7,'href':'/notes/tools/linux/','title':"Linux",'content':"手册 tldr # 安装 sudo pacman -S tldr 查找字符串 ripgrep # 在 python 文件里搜索 rg -tpy foo grep[1] grep -rl \u0026quot;string\u0026quot; /path 网络 curl 上传时显示进度条[2] curl ... | tee /dev/null urlencode 参数[3] curl ... --data-urlencode \u0026quot;paramName=value\u0026quot; 终端 tmux # 列出会话 tmux ls  # 创建新会话 tmux new -s myname  # 连接会话 tmux a -t myname 硬盘  https://github.com/bootandy/dust  jq 过滤[4] select(.name == \u0026quot;TAG\u0026quot;) Print strings without quotes[5] jq --raw-output CPU cat /proc/cpuinfo 参考文献 [1] ASKUBUNTU. How to use \"grep\" command to find text including subdirectories[EB/OL](2011–08–01). https://askubuntu.com/questions/55325/how-to-use-grep-command-to-find-text-including-subdirectories.\n [2] STACKOVERFLOW. cURL: How to display progress information while uploading?[EB/OL](2012–04–02). https://stackoverflow.com/questions/9973056/curl-how-to-display-progress-information-while-uploading/41860083.\n [3] STACKOVERFLOW. How to urlencode data for curl command?[EB/OL](2017–08–14). https://stackoverflow.com/questions/296536/how-to-urlencode-data-for-curl-command.\n [4] STEDOLAN. Cookbook[EB/OL](2019–10–05). https://github.com/stedolan/jq/wiki/Cookbook.\n [5] GITHUB. Print strings without quotes[EB/OL](2013–12–20). https://github.com/stedolan/jq/issues/250.\n  目录  手册  tldr  查找字符串  ripgrep grep[1]  网络  curl  上传时显示进度条[2] urlencode 参数[3]   终端  tmux  硬盘 jq  过滤[4] Print strings without quotes[5]  CPU 参考文献   "});index.add({'id':8,'href':'/notes/math/','title':"Maths",'content':""});index.add({'id':9,'href':'/notes/program/','title':"Programs",'content':""});index.add({'id':10,'href':'/notes/program/python/','title':"Python",'content':"内建函数[1] property 定义属性，默认只读。\nclass Parrot:  def __init__(self):  self._voltage = 100000   @property  def voltage(self):  \u0026quot;\u0026quot;\u0026quot;Get the current voltage.\u0026quot;\u0026quot;\u0026quot;  return self._voltage classmethod 带 cls 的类方法。\nclass C:  @classmethod  def f(cls, arg1, arg2, ...): ... 参考文献 [1] PYTHON. Built-in Functions[EB/OL]([日期不详]). https://docs.python.org/3/library/functions.html#built-in-functions.\n  目录  内建函数[1]  property classmethod  参考文献   "});index.add({'id':11,'href':'/notes/tags/','title':"Tags",'content':""});index.add({'id':12,'href':'/notes/tools/','title':"Tools",'content':""});index.add({'id':13,'href':'/notes/visual/unity/','title':"Unity",'content':"导入 .obj 文件时 x 轴会取反[1] 参考文献 [1] STACKOVERFLOW. Unity flips x coordinate in obj using importer at runtime[EB/OL](2018–08–27). https://stackoverflow.com/a/52044185.\n  目录  导入 .obj 文件时 x 轴会取反[1] 参考文献   "});index.add({'id':14,'href':'/notes/visual/','title':"Visuals",'content':""});index.add({'id':15,'href':'/notes/tools/writing/','title':"写作",'content':"Pandoc pandoc --print-default-template=html 静态网站生成器 静态网站生成器列表：https://www.staticgen.com/。\nHugo 常用命令 # 查看程序版本 hugo version  # 创建网站 hugo new site quickstart  # 添加内容 hugo new posts/my-first-post.md 主题  文档：https://github.com/alex-shpak/hugo-book 博客：https://github.com/ribice/kiss  Citation Style Language Official repository for Citation Style Language (CSL) citation styles: https://github.com/citation-style-language/styles。\n目录  Pandoc 静态网站生成器  Hugo  常用命令 主题   Citation Style Language   "});index.add({'id':16,'href':'/notes/tools/compress/','title':"压缩",'content':"tar 打包时排除某些目录[1] tar --exclude=\u0026#39;./folder1\u0026#39; --exclude=\u0026#39;./folder2\u0026#39; -czvf filename.tar.gz . 参考文献 [1] STACKOVERFLOW. Shell command to tar directory excluding certain files/folders[EB/OL](2009–06–11). https://stackoverflow.com/a/984259.\n  目录  tar 打包时排除某些目录[1] 参考文献   "});index.add({'id':17,'href':'/notes/tools/version-control/','title':"版本控制",'content':"Git Git Submodule # 下载 submodule git submodule update --init --force --recursive --depth=1 目录  Git  Git Submodule    "});index.add({'id':18,'href':'/notes/math/linear-algebra/','title':"线性代数",'content':"相似矩阵  同一个线性变换在不同基下的矩阵称为相似矩阵  目录  相似矩阵   "});index.add({'id':19,'href':'/notes/','title':"首页",'content':"笔记列表  数学  线性代数   视觉  Unity   工具  写作 Linux 版本控制 压缩 API   编程  Python Bash Golang JavaScript CSS HTML    "});})();